       let res= await fetch('https://jsonplaceholder.typicode.com/todos')
       let result=await res.json()
       console.log(result);
       setdata(result)
        console.log(data);
    }
    useEffect(function(){
        loadusers();
    },[])
    
  
  return (
    <div>
       <h1>hi</h1>
    </div>
  )
}

export default A
